import logo from './logo.svg';
import './App.css';
import Navbar from './components/Navbar';

function App() {
  const myStyle={
    backgroundImage:`url(${process.env.PUBLIC_URL+ "cute.jpg"})`,
            height:'100vh',
            marginTop:'-70px',
            fontSize:'50px',
            backgroundSize: 'cover',
            backgroundRepeat: 'no-repeat',
            }
  return (
    <>
    <div myStyle={myStyle}>
      <Navbar/>
    </div>
    </>
  );
}

export default App;
